import React, { createContext } from 'react';
import CompA from './ComA';
// import Effect from './Effect';

const FullName = createContext()
const myChannelName = createContext();
const App = ()=>{
return(
    <>
    <FullName.Provider value = 'Zeeshan Mehmood'>
       <CompA/> 
    </FullName.Provider>
    <myChannelName.Provider value ='Shanigaming'>
        <CompA/>
    </myChannelName.Provider>
   <Effect/>

    </>
)
}


export default App;
export {FullName,myChannelName}
